public int computeIdleExecutors() {
    int r=0;
    for (Computer c : Jenkins.getInstance().getComputers()) {
        Node node = c.getNode();
        if (node != null && node.getMode() == Mode.NORMAL && (c.isOnline() || c.isConnecting())) {
            r += c.countIdle();
        }
    }
    return r;
}

